DROP TABLE IF EXISTS `dynamic_form_detail`;
CREATE TABLE `dynamic_form_detail`  (
  `Id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '自增主键',
  `DynamicId` bigint(20) NOT NULL COMMENT '动态表单Id （父级模块id）',
  `Label` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'label名称',
  `Field` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '字段命名',
  `Type` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '组件名称',
  `IsDisabled` tinyint(1) NULL DEFAULT NULL COMMENT '只读: 0 :false 1:true',
  `IsRequired` tinyint(1) NULL DEFAULT NULL COMMENT '必填项: 0 :false 1:true （自定义组件必须选0）',
  `Options` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '下拉查询条件',
  `Unit` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '单位',
  `Pattern` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '验证提示信息',
  `RegExp` varchar(150) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '正则表达式',
  `Placeholder` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `Col` smallint(1) NULL DEFAULT NULL COMMENT '布局',
  `ReadonlyStatusIDs` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '只读状态',
  `MinView` int(2) NULL DEFAULT NULL COMMENT '日期组件最小选择视图',
  `StartView` int(2) NULL DEFAULT NULL COMMENT '日期组件开始视图 &&文本框的行数',
  `FieldOrder` int(2) NULL DEFAULT NULL,
  `IsComponent` tinyint(1) NULL DEFAULT NULL COMMENT '是否是自定义组件 1-是',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2625 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '动态表单子表' ROW_FORMAT = Compact;

